package backtosquaretwobasic;

public class AutoBoxingUnboxing {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//Auto boxing
		int a = 20;
		//Integer b = Integer.valueOf(a);
		Integer b = a;
		System.out.println(b);
		
		
		//Unboxing
		Integer c = 3;
		int i ;
		i = c;
		System.out.println(i);

	}

}
